import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Header from './Components/Head/head.js';

class App extends React.Component {
  render() {
    return(
      <>
        <Header />
      </>
    )
  }
}

const head = [
  {name: 'home'},
  {name: 'about'},
  {name: 'work'},
  {name: 'process'},
  {name: 'services'},
  {name: 'testimonials'},
  {name: 'contact'}
];

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
